import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  drawerContainer: {
    overflow: 'auto',
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

export default function ClippedDrawer() {
  const classes = useStyles();

  return (
    <Drawer
    variant="permanent"
    className={clsx(classes.drawer, {
      [classes.drawerOpen]: open,
      [classes.drawerClose]: !open,
    })}
    classes={{
      paper: clsx({
        [classes.drawerOpen]: open,
        [classes.drawerClose]: !open,
      }),
    }}
  >
    <div className={classes.toolbar}>
        <div style={{ width: '100px' }}>
        Punithargal
        </div>
      <IconButton onClick={handleDrawerClose}>
        {theme.direction === 'rtl' ? <MenuIcon /> : <MenuIcon />}
      </IconButton>
    </div>
    <Divider />
    <List>
    <Tooltip title="Home" placement="right">
      <ListItem button >
            <ListItemIcon><HomeIcon /></ListItemIcon>
            <ListItemText >Home</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Essay" placement="right">
      <ListItem button >
          <ListItemIcon><AppsIcon /></ListItemIcon>
          <ListItemText >Essay</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Calender" placement="right">
      <ListItem button >
          <ListItemIcon><EventIcon /></ListItemIcon>
          <ListItemText >Calender</ListItemText>
      </ListItem>
    </Tooltip>
    </List>
    <Divider />
    <List>
    <Tooltip title="Library" placement="right">
      <ListItem button >
          <ListItemIcon><VideoLibraryIcon /></ListItemIcon>
          <ListItemText >Library</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Trending Videos" placement="right">
      <ListItem button >
            <ListItemIcon><WhatshotIcon /></ListItemIcon>
            <ListItemText >Trending Videos</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Recent Videos" placement="right">
      <ListItem button >
          <ListItemIcon><MusicVideoIcon /></ListItemIcon>
          <ListItemText >Recent Videos</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Popular Saints" placement="right">
      <ListItem button >
          <ListItemIcon><PollIcon /></ListItemIcon>
          <ListItemText >Popular Saints</ListItemText>
      </ListItem>
    </Tooltip>
    <Tooltip title="Mother Mary" placement="right">
      <ListItem button >
          <ListItemIcon><ViewQuiltIcon /></ListItemIcon>
          <ListItemText >Mother Mary</ListItemText>
      </ListItem>
    </Tooltip>
    </List>
  </Drawer>
  );
}
